function mywebform_mark_error_field(error, markedPages) {
    var field = Drupal.settings.mywebform.fields[error.fieldName];
    var errorClass = error.type == 'warning' ? 'warning' : 'error';
    var parentIndex = parseInt(error.parentIndex);
    parentIndex = isNaN(parentIndex) ? 0 : parentIndex + 1;

    if (field) {
        if (field.grid_name == '') {
            var elem = jQuery('#' + error.fieldName);
        } else {
            var index = parseInt(error.index) + 1;
            var elem = [];

            if (field.parent_grid_name) {
                if (parentIndex) {
                    elem = jQuery('#' + error.fieldName + '-' + parentIndex + '-' + index);
                }
            } else {
                elem = jQuery('#' + error.fieldName + '-' + index);
            }

            // Find the page and set it an error
            var pageNr = Math.ceil(index / 50);
            var gridName = field.grid_name;
            if (parentIndex) {
                gridName += '-' + parentIndex;
            }

            if (typeof markedPages[gridName] == 'undefined') {
                markedPages[gridName] = {};
            }

            if (typeof markedPages[gridName][pageNr] == 'undefined') {
                markedPages[gridName][pageNr] = true;
                const $pageInput = jQuery('#mywebform-edit-form #' + gridName + ' .' + gridName + '-' + 'grid-scroll input.page-jump');
                if ($pageInput.length && $pageInput.val() == pageNr && !$pageInput.hasClass('error')) {
                    $pageInput.addClass('error');
                }
                const $pageItem = jQuery('#mywebform-edit-form #' + gridName + ' .' + gridName + '-' + 'grid-scroll a.page-jump.page-' + pageNr);
                if ($pageItem.length && !$pageItem.hasClass('error')) {
                    $pageItem.addClass('error');
                }
            }
        }

        if (elem.length) {
            if (!elem.hasClass(errorClass)) {
                elem.addClass(errorClass);
            }

            if (field.widget == 'select2') {
                var $select2Container = elem.siblings('span.select2-container');
                if ($select2Container.length && !$select2Container.hasClass(errorClass)) {
                    $select2Container.addClass(errorClass);
                }
            }
        }
    }
}

// Special functions to user in autofields

function sum(values) {
    var sum_value = 0.0;

    for (x in values) {
        var val = new String(values[x]);
        val = parseFloat(val.replace(',', '.'));
        if (isNaN(val)) {
            val = 0.0;
        }
        sum_value += val;
    }

    return sum_value;
}

function sum_if_not_equal(summable_values, checkable_values, value) {
    var sum_value = 0.0;
    value = value.split(',')

    for (x in summable_values) {
        if (value.indexOf(checkable_values[x]) == -1) {
            var val = new String(summable_values[x]);
            val = parseFloat(val.replace(',', '.'));
            if (isNaN(val)) {
                val = 0.0;
            }
            sum_value += val;
        }
    }

    return sum_value;
}

function sum_if_equals(summable_values, checkable_values, value) {
    var sum_value = 0.0;
    value = value.split(',');
    for (x in summable_values) {
        if (value.indexOf(checkable_values[x]) != -1) {
            var val = new String(summable_values[x]);
            val = parseFloat(val.replace(',', '.'));
            if (isNaN(val)) {
                val = 0.0;
            }
            sum_value += val;
        }
    }

    return sum_value;
}

function row_count(values) {
    var count = 0;
    for (keyvar in values) {
        if (values[keyvar] !== '') {
            count++;
        }
    }

    return count;
}

function min(value1, value2) {
    var v1 = parseFloat(value1);
    var v2 = parseFloat(value2);
    var result = (v1 <= v2) ? v1 : v2;
    return isNaN(result) ? 0 : result;
}

function max(value1, value2) {
    var v1 = parseFloat(value1);
    var v2 = parseFloat(value2);
    var result = (v1 >= v2) ? v1 : v2;
    return isNaN(result) ? 0 : result;
}

function abs(value) {
    return Math.abs(parseFloat(value));
}

function positive_only(value) {
    if (isNaN(value)) {
        return 0;
    }
    return value > 0 ? value : 0;
}

function negative_only(value) {
    if (isNaN(value)) {
        return 0;
    }
    return value < 0 ? value : 0;
}

function is_negative(value) {
    value = parseFloat(value);

    return value < 0 ? true : false;
}

function formatNumber(num, numAfterPoint) {
    numAfterPoint = parseInt(numAfterPoint) || 0;
    var str = num.toString();
    str = str.replace(',', '.');
    if (isNaN(str)) {
        str = new Number(0);
    }
    var formatNum = new Number(str);

    return new Decimal(formatNum.toString()).toFixed(numAfterPoint);
}

function toFloat(val) {
    if (typeof val === 'boolean') {
        return val ? 1.0 : 0.0;
    }

    try {
        val = new String(val);
        val = parseFloat(val.replace(',', '.'));
        if (isNaN(val)) {
            val = 0.0;
        }
        return val;
    }
    catch (err) {
        return 0.0;
    }
}

function isFieldsHasValue(fieldValue) {
    var args = arguments;

    var length = args.length;
    if (length) {
        for (var i = 0; i < length; i++) {
            var value = args[i];

            if (value instanceof Array && value.length) {
                for (var j = 0; j < value.length; j++) {
                    if (value[j] !== '') {
                        return true;
                    }
                }
            } else {
                if (value !== '') {
                    return true;
                }
            }
        }
    }

    return false;
}

// Converts a group of checkboxes into a radio set
function radio_checkbox(group, obj) {
    var group_type = typeof group;
    if ((group_type == 'string' && obj.attr('field').indexOf(group) == 0) || (group_type == 'object' && group.indexOf(obj.attr('field')) != -1)) {
        jQuery('input:checkbox').each(function () {
            var fieldName = jQuery(this).attr('field');
            if (fieldName) {
                if ((group_type == 'string' && fieldName.indexOf(group) == 0) || (group_type == 'object' && group.indexOf(fieldName) != -1)) {
                    jQuery(this).prop('checked', false).trigger('change');
                }
            }
        });
        obj.prop('checked', true).trigger('change');
    }
}

function getCaretPosition(element) {
    return element.selectionStart;
}

function setCaretPosition(element, position) {
    if (element.setSelectionRange) {
        element.focus();
        element.setSelectionRange(position, position);
    }
}

function isNumberPressed(element, event, allowNegative) {
    allowNegative = allowNegative || false;
    var char = getChar(event);
    var caretPos = getCaretPosition(element);

    if (char === null) {
        return true;
    }

    var fieldName = element.getAttribute('field');
    var field = Drupal.settings.mywebform.fields[fieldName];

    var isAllowedNegativeChar = function () {
        var negativeCharPos = element.value.indexOf("-");
        if (allowNegative && char == '-' && negativeCharPos === -1 && caretPos === 0) {
            return true;
        }

        return false;
    };

    var is_number = true;
    switch (field.type) {
        case 'numeric':
            if (char == '-') {
                is_number = isAllowedNegativeChar();
            } else if (char < '0' || char > '9') {
                is_number = false;
            }
            break;
        case 'float':
        case 'money':
            var decimal_length = field.decimal_length;
            if (field.type == 'money' || decimal_length == 0) {
                decimal_length = 2;
            }

            var numberParsed = element.value.split('.');
            if (char == '.') {
                if (numberParsed.length > 1) {
                    is_number = false;
                }
            } else if (char == '-') {
                is_number = isAllowedNegativeChar();
            } else if (char < '0' || char > '9') {
                is_number = false;
            } else if (char >= '0' && char <= '9') {
                var dotPos = element.value.indexOf(".");
                if (dotPos > -1 && caretPos > dotPos && numberParsed[1].length >= decimal_length) {
                    is_number = false;
                }
            }
            break;
    }

    return is_number;
}

function getChar(event) {
    if (event.ctrlKey || event.altKey || event.metaKey) {
        return null;
    }

    // IE
    if (event.which == null) {
        if (event.keyCode < 32) {
            return null;
        }

        return String.fromCharCode(event.keyCode);
    } else if (event.which != 0 && event.charCode != 0) {
        if (event.which < 32) {
            return null
        };

        return String.fromCharCode(event.which);
    }

    return null;
}

function convertDiacriticSymbols(str) {
    var diacriticsMap = {
        'Ă': 'A',
        'ă': 'a',
        'Â': 'A',
        'â': 'a',
        'Î': 'I',
        'î': 'i',
        'Ş': 's',
        'ş': 's',
        'Ș': 'S',
        'ș': 's',
        'Ţ': 't',
        'ţ': 't',
        'Ț': 'T',
        'ț': 't'
    };

    var symbols = [];
    for (var symbol in diacriticsMap) {
        symbols.push(symbol);
    }

    function convert(match) {
        return diacriticsMap.hasOwnProperty(match) ? diacriticsMap[match] : match;
    }

    var s = String(str);
    var exp = new RegExp('[' + symbols.join('') + ']', 'g');
    return s.replace(exp, convert);
}

function onInputConvertToUpperCase(element) {
    var caretPos = getCaretPosition(element);
    var $element = jQuery(element);
    $element.val($element.val().toUpperCase());
    setCaretPosition(element, caretPos);
}

function getMywebformGridRowNumber(fieldName, index, parentIndex) {
    parentIndex = parseInt(parentIndex);

    var rowNumber = '';
    var field = Drupal.settings.mywebform.fields[fieldName];
    if (field && field.grid_name) {
        var defFieldName = Drupal.settings.mywebform.grids[field.grid_name].defField;
        var values = [];
        var rowNumber = parseInt(index) + 1;

        if (Drupal.settings.mywebform.values.hasOwnProperty(defFieldName)) {
            values = Drupal.settings.mywebform.values[defFieldName];
            if (field.parent_grid_name && parentIndex >= 0) {
                values = values[parentIndex];
            }

            if (values[index] &&
                (typeof values[index] == 'string' || typeof values[index] == 'number')
            ) {
                rowNumber = values[index];
            }
        }
    }

    return rowNumber;
}

function leadingZero(n) {
    if (n > 9) {
        return String(n);
    } else {
        return '0' + n;
    }
}

function getLastDayOfMonth(year, month) {
    var date = new Date(year, month + 1, 0);
    return date.getDate();
}

function confirmWarnings(warnings, messages) {
    var i;
    if (messages !== '') {
        if (webform.prevalidate) {
            for (i = 0; i < warnings.length; i++) {
                warnings[i].type = 'warning';
                webform.errors.push(warnings[i]);
            }
        } else if (!confirm(Drupal.t('The following inconsistencies were found:\n\n@messages\nWant to continue?', {
            '@messages': messages
        }))) {
            for (i = 0; i < warnings.length; i++) {
                warnings[i].type = 'warning';
                webform.errors.push(warnings[i]);
            }
        } else {
            for (i = 0; i < warnings.length; i++) {
                webform.warnings.push(warnings[i]);
            }
        }
    }
}

function validationMarkFields() {
    jQuery('#mywebform-edit-form .grid-scroll .page-jump').removeClass('error');

    var markedPages = {};
    for (var x in webform.errors) {
        if (webform.errors[x].fieldName) {
            mywebform_mark_error_field(webform.errors[x], markedPages);
        }
    }
}
