class MyWebformGridBase {

    /**
     * Initialize all grids
     */
    static grids_initialize() {
        jQuery("a.grid-addrow").addClass("disabled");

        jQuery.each(webform.beforeLoad, function () { this(); });

        for (const gridName of Drupal.settings.mywebform.gridsUpperLevel) {
            this.grid_initialize(this.grid_get_grid_element(gridName), gridName, Drupal.settings.mywebform.grids[gridName]);
        }

        jQuery("a.grid-addrow").removeClass("disabled");

        setTimeout("jQuery.each(webform.afterLoad, function() {this();});", 10);
        Drupal.settings.mywebform.gridsPages = {};
    }

    static grid_initialize($grid, gridName, gridInfo, parentIndex) {
        // Initialize grid's parameters
        grids[gridName] = {
            "gridInfo": gridInfo,
            "page_limit": Drupal.settings.mywebform.grid_page_limit,
            "offset": 0,
            "pages": 0,
            "curPage": 0,
            "count": 0,
            "parentIndex": false,
        };

        if (gridInfo.parentGrid.length && parentIndex) {
            grids[gridName].parentIndex = Number(parentIndex);
        }
        parentIndex = grids[gridName].parentIndex;

        this.grid_set_initial_data(gridName, gridInfo, parentIndex);
        this.grid_set_attr($grid, gridName);
        this.grid_initialize_pager($grid, gridName, true);
        this.grid_update_pager($grid, gridName);

        if (typeof Drupal.settings.mywebform.gridsPages === 'object' && gridName in Drupal.settings.mywebform.gridsPages) {
            const page = min(grids[gridName].pages, Number(Drupal.settings.mywebform.gridsPages[gridName]));
            grids[gridName].offset = (page - 1) * grids[gridName].page_limit;
            delete Drupal.settings.mywebform.gridsPages[gridName];
        }

        this.grid_initialize_view($grid, gridName);
    }

    static grid_initialize_view($grid, gridName) {
        // Refresh grid
        if (grids[gridName].count) {
            this.grid_refresh($grid, gridName, grids[gridName].offset);
        }
        else {
            // Delayed add row execution to wait while all event handlers will be appended
            const row_count = this.grid_get_default_row_count(gridName);
            for (let c = 0; c < row_count; c++) {
                setTimeout("jQuery('#" + gridName + " a." + this.grid_combine_class(gridName, "grid-addrow") + "').trigger('click');", 10);
            }
        }
    }

    static register_events() {
        const self = this;
        jQuery("#mywebform-edit-form").submit(function () {
            // Serialize grid values before submit
            const str = JSON.stringify(Drupal.settings.mywebform.values);
            jQuery("#serialized_data").val(str);
        });

        jQuery("#mywebform-edit-form").on("click", "a.grid-addrow", function () {
            if (!jQuery(this).hasClass("disabled")) {
                const gridName = jQuery(this).attr("grid");
                self.grid_add_row(gridName);
            }

            return false;
        });

        jQuery("#mywebform-edit-form").on("click", "a.grid-addrow-inline", function (ev) {
            if (!jQuery(this).hasClass("disabled")) {
                const gridName = jQuery(this).attr("grid");
                const rowIndex = parseInt(jQuery(this).parents("." + self.grid_combine_class(gridName, "row")).attr("row-index"));
                self.grid_add_row_inline(gridName, rowIndex);
            }

            return false;
        });

        jQuery("#mywebform-edit-form").on("click", ".delrow a", function (evt) {
            const gridName = jQuery(this).attr("grid");
            const row = jQuery(this).parents("." + self.grid_combine_class(gridName, "row"));
            let index = parseInt(row.attr("row-index"));
            const $gridElement = jQuery("#" + gridName);
            const default_row_count = self.grid_get_default_row_count(gridName);

            if (!$gridElement.hasClass("grid-delete-row-processing")) {
                if (index < 1) {
                    index = 0;
                }

                if (default_row_count > 0 && grids[gridName].count <= 1) {
                    return false;
                }

                $gridElement.addClass("grid-delete-row-processing");
                row.hide();
                row.find("input, select").each(function () {
                    const fieldName = jQuery(this).attr("field");
                    const field = Drupal.settings.mywebform.fields.hasOwnProperty(fieldName) ? Drupal.settings.mywebform.fields[fieldName] : false;

                    if (field && field.autofield.length) {
                        const row_index = jQuery(this).attr("row-index");
                        if (row_index) {
                            jQuery(this).addClass("unprocessed");
                            jQuery(this).val("").trigger("change");
                        }
                    }
                });

                const timerId = setInterval(function () {
                    const unprocessedFields = row.find("input.unprocessed, select.unprocessed");
                    if (!unprocessedFields.length) {
                        clearInterval(timerId);
                        setTimeout(function () { self.grid_remove_row(gridName, index); }, 10);
                    }
                }, 50);
            }

            return false;
        });

        this.register_pager_events("#mywebform-edit-form");
    }

    static register_pager_events(container_id) {
        const self = this;
        jQuery(container_id).on("click", ".scroll-start", function () {
            const gridName = jQuery(this).attr("grid");
            self.grid_refresh(self.grid_get_grid_element(gridName), gridName, 0);
            return false;
        });

        jQuery(container_id).on("click", ".scroll-end", function (evt) {
            const gridName = jQuery(this).attr("grid");
            const offset = (grids[gridName].pages - 1) * grids[gridName].page_limit;

            self.grid_refresh(self.grid_get_grid_element(gridName), gridName, offset);
            return false;
        });

        jQuery(container_id).on("click", ".scroll-pgup", function () {
            const gridName = jQuery(this).attr("grid");
            const offset = Math.min(grids[gridName].pages - 1, grids[gridName].curPage) * grids[gridName].page_limit;
            self.grid_refresh(self.grid_get_grid_element(gridName), gridName, offset);
            return false;
        });

        jQuery(container_id).on("click", ".scroll-pgdn", function () {
            const gridName = jQuery(this).attr("grid");
            const offset = Math.max(0, grids[gridName].curPage - 2) * grids[gridName].page_limit;
            self.grid_refresh(self.grid_get_grid_element(gridName), gridName, offset);
            return false;
        });

        jQuery(container_id).on("click", ".scroll-down", function () {
            var gridName = jQuery(this).attr("grid");
            var offset = Math.max(grids[gridName].offset - 1, 0);
            self.grid_refresh(self.grid_get_grid_element(gridName), gridName, offset);
            return false;
        });

        jQuery(container_id).on("click", ".scroll-up", function () {
            var gridName = jQuery(this).attr("grid");
            var offset = Math.min(grids[gridName].offset + 1, grids[gridName].count - 1);
            self.grid_refresh(self.grid_get_grid_element(gridName), gridName, offset);
            return false;
        });

        jQuery(container_id).on("change", "input.page-jump", function () {
            const gridName = jQuery(this).attr("grid");
            let page = parseInt(jQuery(this).val());
            let offset = (page - 1) * grids[gridName].page_limit;
            if (offset > grids[gridName].count) {
                page = Math.max(1, Math.ceil(grids[gridName].count / grids[gridName].page_limit));
                offset = (page - 1) * grids[gridName].page_limit;
            } else if (page < 1) {
                offset = 0;
            }
            self.grid_refresh(self.grid_get_grid_element(gridName), gridName, offset);
            return false;
        });
    }

    /**
     * Update grid's pager
     */
    static grid_update_pager($grid, gridName) {
        const pages = Math.max(1, Math.ceil(grids[gridName].count / grids[gridName].page_limit));
        const curPage = Math.floor(grids[gridName].offset / grids[gridName].page_limit) + 1;
        const $pager = $grid.find("." + this.grid_combine_class(gridName, "grid-scroll"));

        if (pages != grids[gridName].pages) {
            grids[gridName].pages = pages;
            grids[gridName].curPage = 0;

            $pager.find("input.page-jump").attr("max", pages);

            if (pages == 1) {
                $pager.hide();
            }
            else {
                $pager.show();
            }
        }

        if (curPage != grids[gridName].curPage) {
            grids[gridName].curPage = curPage;
        }

        if ($pager.find("input.page-jump").val() != curPage) {
            $pager.find("input.page-jump").val(curPage);
        }

        $pager.find(".pages-info .cur-page").html(curPage);
        $pager.find(".pages-info .total-pages").html(pages);
    }

    static grid_get_grid_element(gridName) {
        return jQuery("#" + gridName);
    }

    static grid_set_attr($grid, gridName) {
        $grid.find(".drow .drow").addClass("child-grid");
        $grid.find(".drow a.grid-addrow").addClass("child-grid");
        $grid.find(".drow .drow a.grid-addrow-inline").addClass("child-grid");
        $grid.find(".drow .drow .delrow a").addClass("child-grid");
        $grid.find(".drow .drow .row-index").addClass("child-grid");

        $grid.find("a.grid-addrow:not(.child-grid)")
            .attr("grid", gridName)
            .addClass(this.grid_combine_class(gridName, "grid-addrow"));
        $grid.find("a.grid-addrow-inline:not(.child-grid)")
            .attr("grid", gridName)
            .addClass(this.grid_combine_class(gridName, "grid-addrow-inline"));
        $grid.find(".delrow a:not(.child-grid)")
            .attr("grid", gridName)
            .addClass(this.grid_combine_class(gridName, "grid-delrow"));

        $grid.find(".drow:not(.child-grid)")
            .addClass(this.grid_combine_class(gridName, "drow"));

        $grid.find(".row-index:not(.child-grid)")
            .addClass(this.grid_combine_class(gridName, "row-index"));

        $grid.find(".child-grid").removeClass("child-grid");
    }

    static grid_combine_class(gridName, elementClass) {
        const prefixClass = String(gridName);

        return prefixClass + "-" + String(elementClass);
    }

    static grid_initialize_pager($grid, gridName, addLineScrollButtons) {
        // Insert grid's scroll buttons and pages
        let str = "";
        str += "<div class=\"grid-scroll " + this.grid_combine_class(gridName, "grid-scroll") + "\">";
        str += "<ul class=\"scroll\">";
        str += "<li><a href=\"#\" grid=\"" + gridName + "\" class=\"scroll-start\">Start</a></li>";
        str += "<li><a href=\"#\" grid=\"" + gridName + "\" class=\"scroll-pgdn\">Page down</a></li>";
        if (addLineScrollButtons) {
            str += "<li><a href=\"#\" grid=\"" + gridName + "\" class=\"scroll-down\">Line down</a></li>";
        }
        str += "<li><input grid=\"" + gridName + "\" class=\"page-jump\" type=\"number\" min=\"1\" max=\"1\"></li>";
        if (addLineScrollButtons) {
            str += "<li><a href=\"#\" grid=\"" + gridName + "\" class=\"scroll-up\">Line up</a></li>";
        }
        str += "<li><a href=\"#\" grid=\"" + gridName + "\" class=\"scroll-pgup\">Page up</a></li>";
        str += "<li><a href=\"#\" grid=\"" + gridName + "\" class=\"scroll-end\">End</a></li>";
        str += "</ul>";
        str += "<div class=\"pages-info\">" + Drupal.t('Page <span class="cur-page">@cur_page</span> of <span class="total-pages">@total_pages</span>', { '@cur_page': 1, '@total_pages': 1 }) + "<div>";
        str += "<div style=\"clear: both;\"></div>";
        str += "</div>";
        $grid.prepend(str);
    }

    static grid_set_initial_data(gridName, gridInfo, parentIndex) {
        const total = gridInfo.fields.length;

        let count = 0;
        for (let i = 0; i < total; i++) {
            const fieldName = gridInfo.fields[i];
            count = this.grid_count_field_values(fieldName, parentIndex);

            if (count > 0) {
                break;
            }
        }

        count = Number(count);
        if (isNaN(count)) {
            count = 0;
        }

        grids[gridName].count = count;
    }

    static grid_count_field_values(fieldName, parentIndex) {
        const index = Number(parentIndex) - 1;
        const values = this.grid_get_field_values(fieldName, index);
        const count = values.length;

        return count;
    }

    static grid_get_parent_index(gridName) {
        let parentIndex = false;

        if (grids.hasOwnProperty(gridName)) {
            if (grids[gridName].gridInfo.parentGrid.length) {
                parentIndex = Number(grids[gridName].parentIndex);
            }
        }

        return parentIndex;
    }

    static grid_get_field_values(fieldName, parentIndex) {
        let values = [];
        if (Drupal.settings.mywebform.values.hasOwnProperty(fieldName)) {
            values = Drupal.settings.mywebform.values[fieldName];

            if (values instanceof Array) {
                if (parentIndex > 0 || parentIndex === 0) {
                    values = Drupal.settings.mywebform.values[fieldName][parentIndex];
                    if (!(values instanceof Array)) {
                        values = [];
                    }
                }
            } else {
                values = [];
            }
        }

        return values;
    }

    static grid_is_file_field(fieldName) {
        const field = Drupal.settings.mywebform.fields[fieldName];

        if (field && field.widget == "file") {
            return true;
        }

        return false;
    }

    static grid_push_field_value(fieldName, value, parentIndex, toIndex) {
        this.grid_push_value("values", fieldName, value, parentIndex, toIndex);
    }

    static grid_push_file_value(fieldName, value, parentIndex, toIndex) {
        this.grid_push_value("files", fieldName, value, parentIndex, toIndex);
    }

    static grid_push_value(key, fieldName, value, parentIndex, toIndex) {
        if (!(Drupal.settings.mywebform[key][fieldName] instanceof Array)) {
            Drupal.settings.mywebform[key][fieldName] = [];
        }

        if (parentIndex > 0 || parentIndex === 0) {
            if (toIndex > 0 || toIndex === 0) {
                Drupal.settings.mywebform[key][fieldName][parentIndex].splice(toIndex, 0, value);
            } else {
                Drupal.settings.mywebform[key][fieldName][parentIndex].push(value);
            }
        } else {
            if (toIndex > 0 || toIndex === 0) {
                Drupal.settings.mywebform[key][fieldName].splice(toIndex, 0, value);
            } else {
                Drupal.settings.mywebform[key][fieldName].push(value);
            }
        }
    }

    static grid_remove_field_value(fieldName, index, parentIndex) {
        this.grid_remove_value("values", fieldName, index, parentIndex);
    }

    static grid_remove_file_value(fieldName, index, parentIndex) {
        this.grid_remove_value("files", fieldName, index, parentIndex);
    }

    static grid_remove_value(key, fieldName, index, parentIndex) {
        if (parentIndex > 0 || parentIndex === 0) {
            Drupal.settings.mywebform[key][fieldName][parentIndex].splice(index, 1);
        } else {
            Drupal.settings.mywebform[key][fieldName].splice(index, 1);
        }
    }

    static grid_reset_field_values(fieldName, parentIndex) {
        this.grid_reset_values("values", fieldName, parentIndex);
    }

    static grid_reset_file_values(fieldName, parentIndex) {
        this.grid_reset_values("values", fieldName, parentIndex);
    }

    static grid_reset_values(key, fieldName, parentIndex) {
        if (parentIndex > 0 || parentIndex === 0) {
            Drupal.settings.mywebform[key][fieldName][parentIndex] = [];
        } else {
            Drupal.settings.mywebform[key][fieldName] = [];
        }
    }

    static grid_init_children_fields(gridName, toIndex) {
        const childrenCount = grids[gridName].gridInfo.grids.length;

        for (let i = 0; i < childrenCount; i++) {
            const childGridName = grids[gridName].gridInfo.grids[i];
            const fields = Drupal.settings.mywebform.grids[childGridName].fields;

            for (let k = 0; k < fields.length; k++) {
                const fieldName = fields[k];
                this.grid_push_field_value(fieldName, [], -1, toIndex);

                if (this.grid_is_file_field(fieldName)) {
                    this.grid_push_file_value(fieldName, {}, -1, toIndex);
                }
            }
        }
    }

    static grid_get_drow($grid, gridName) {
        const drowClass = this.grid_combine_class(gridName, "drow");

        return $grid.find("." + drowClass);
    }

    static grid_get_unprocessed_row_from_drow(gridName, drow_original) {
        const drowClass = this.grid_combine_class(gridName, "drow");
        const drow = drow_original.clone();
        drow.removeClass("drow " + drowClass).show();
        drow.find(".drow").find("input, select, span.form-item").addClass("child-grid");
        drow.find("input, select").not(".child-grid").addClass("unprocessed");

        return drow;
    }

    static grid_prepare_row(gridName, unprocessedRow, index) {
        const row = unprocessedRow.clone();
        const rowClass = this.grid_combine_class(gridName, "row");
        let parentIndex = parseInt(this.grid_get_parent_index(gridName));
        parentIndex = isNaN(parentIndex) ? -1 : parentIndex;

        row.addClass("row " + rowClass + " row-" + index);
        row.attr("row-index", index);

        const $fields = row.find("input, select, span.form-item").not(".child-grid");
        this.grid_set_fields_attr($fields, index, parentIndex);
        row.find(".child-grid").removeClass("child-grid");

        this.grid_prepare_children(gridName, row, index);

        return row;
    }

    static grid_set_fields_attr($fields, index, parentIndex) {

        $fields.each(function () {
            const indexes = [];
            const fieldName = jQuery(this).attr("field");

            if (parentIndex > 0 || parentIndex === 0) {
                jQuery(this).attr("parent-index", parentIndex);
                indexes.push(parentIndex);
            }

            if (index > 0 || index === 0) {
                jQuery(this).attr("row-index", index);
                indexes.push(index);
            }

            jQuery(this).attr("name", fieldName + "[" + indexes.join("][") + "]");
            jQuery(this).attr("id", fieldName + "-" + indexes.join("-"));
        });
    }

    static grid_prepare_children(gridName, row, index) {
        const childrenCount = grids[gridName].gridInfo.grids.length;

        for (let i = 0; i < childrenCount; i++) {
            const childGridName = grids[gridName].gridInfo.grids[i];

            const $childGrid = row.find("#" + childGridName).attr("id", childGridName + "-" + index);
            $childGrid.find(".drow .drow").find("input, select, span.form-item").addClass("child-grid");
            const $fields = $childGrid.find(".drow").find("input, select, span.form-item").not(".child-grid");
            this.grid_set_fields_attr($fields, 0, index);
        }
    }

    static grid_initialize_children($grid, gridName, index) {
        const childrenCount = grids[gridName].gridInfo.grids.length;
        for (let i = 0; i < childrenCount; i++) {
            const originalChildGridName = grids[gridName].gridInfo.grids[i];
            if (Drupal.settings.mywebform.grids.hasOwnProperty(originalChildGridName)) {
                const childGridName = originalChildGridName + "-" + index;
                const $childGrid = $grid.find("#" + childGridName);

                this.grid_initialize($childGrid, childGridName, Drupal.settings.mywebform.grids[originalChildGridName], index);
            }
        }
    }

    static grid_get_element_value($element) {
        const index = $element.attr("row-index");
        const parentIndex = this.grid_get_parent_index_from_field($element);
        const fieldName = $element.attr("field");
        const fieldValues = this.grid_get_field_values(fieldName, parentIndex - 1);

        return fieldValues[index - 1];
    }

    static grid_set_input_value($element, value) {
        $element.val(value);
    }

    static grid_init_datepicker($element) {
        if ($element.hasClass("date") && $element.datepicker) {
            $element.datepicker({
                showOtherMonths: true,
                selectOtherMonths: true,
                dateFormat: "dd.mm.yy"
            });
        }
    }

    static grid_is_select2_included() {
        let select2Exists = false;
        if (jQuery.fn.hasOwnProperty("select2")) {
            select2Exists = true;
        }

        return select2Exists;
    }

    static grid_set_select_value($element, value) {
        const isSelect2Field = this.grid_is_select2_included() && $element.hasClass("select2-widget");

        if (isSelect2Field) {
            $element.myWebformSelect2SetVal(value);
        } else {
            $element.val(value);
        }
    }

    static grid_init_select2($element) {
        const isSelect2Field = this.grid_is_select2_included() && $element.hasClass("select2-widget");

        if (isSelect2Field) {
            $element.myWebformSelect2();
        }
    }

    static grid_init_file_widget($element) {
        if ($element.hasClass("mywebform-file-widget")) {
            $element.myWebformFile();
        }
    }

    static grid_is_reindex_enabled(gridName) {
        if (!grids[gridName].hasOwnProperty("reindex")) {
            const $grid = jQuery("#" + gridName);
            grids[gridName].reindex = true;

            if ($grid.length) {
                const reindex = $grid.attr("reindex");
                if (reindex === "disabled") {
                    grids[gridName].reindex = false;
                }
            }
        }

        return grids[gridName].reindex;
    }

    static grid_get_default_min_index(gridName) {
        if (!grids[gridName].hasOwnProperty("defaultMinIndex")) {
            const $grid = jQuery("#" + gridName);
            grids[gridName].defaultMinIndex = 1;

            if ($grid.length) {
                const index = parseInt($grid.attr("grid-min-index"));
                if (!isNaN(index) && index >= 0) {
                    grids[gridName].defaultMinIndex = index;
                }
            }
        }

        return grids[gridName].defaultMinIndex;
    }

    static grid_get_default_row_count(gridName) {
        const $grid = jQuery("#" + gridName);
        let count = 1;

        if ($grid.length) {
            count = parseInt($grid.attr("default-row-count"));
            if (isNaN(count)) {
                count = 1;
            }
        }

        return count;
    }

    static grid_get_parent_index_from_field($field) {
        let parentIndex = Number($field.attr("parent-index"));
        if (isNaN(parentIndex)) {
            parentIndex = 0;
        }

        return parentIndex;
    }

    /**
     * Adds a row to the end of the grid
     */
    static grid_add_row(gridName) {
        const indexField = grids[gridName].gridInfo.defField;
        const $grid = this.grid_get_grid_element(gridName);
        const parentIndex = this.grid_get_parent_index(gridName);
        let maxIndex = 0;
        const defaultMinIndex = this.grid_get_default_min_index(gridName);

        if (indexField) {
            if (this.grid_is_reindex_enabled(gridName)) {
                const fieldValues = this.grid_get_field_values(indexField, Number(parentIndex) - 1);
                maxIndex = parseInt(fieldValues[fieldValues.length - 1]);
            }
        }

        if (isNaN(maxIndex)) {
            maxIndex = 0;
        }

        maxIndex++;
        maxIndex = Math.max(maxIndex, defaultMinIndex);

        let indexValue = maxIndex;
        if (!this.grid_is_reindex_enabled(gridName)) {
            indexValue = "";
        }

        for (const x in grids[gridName].gridInfo.fields) {
            const fieldName = grids[gridName].gridInfo.fields[x];
            if (fieldName == indexField) {
                this.grid_push_field_value(fieldName, indexValue, Number(parentIndex) - 1);
            } else {
                this.grid_push_field_value(fieldName, jQuery("#" + fieldName).val(), Number(parentIndex) - 1);

                if (this.grid_is_file_field(fieldName)) {
                    this.grid_push_file_value(fieldName, {}, Number(parentIndex) - 1);
                }
            }
        }

        this.grid_init_children_fields(gridName);

        grids[gridName].count++;
        const pages = Math.max(1, Math.ceil(grids[gridName].count / grids[gridName].page_limit));
        const offset = (pages - 1) * grids[gridName].page_limit;
        this.grid_refresh($grid, gridName, offset);

        this.grid_trigger_change_index_field($grid, gridName, parentIndex, grids[gridName].count);

        $grid.trigger("row_added");
    }

    static grid_trigger_change_index_field($grid, gridName, parentIndex, index) {
        const fieldName = grids[gridName].gridInfo.defField;
        const field = Drupal.settings.mywebform.fields.hasOwnProperty(fieldName) ? Drupal.settings.mywebform.fields[fieldName] : false;
        if (field) {
            let id = fieldName;
            if (parentIndex) {
                id += "-" + parentIndex;
            }
            id += "-" + index;
            $grid.find("#" + id).trigger("change");
        }
    }

    /**
     * Refreshes the grid rows
     */
    static grid_refresh($grid, gridName, offset) {
        this.grid_remove_rows($grid, gridName, offset);

        const rowClass = this.grid_combine_class(gridName, "row");
        const drow_original = this.grid_get_drow($grid, gridName);
        const drow = this.grid_get_unprocessed_row_from_drow(gridName, drow_original);

        let row_count = $grid.find("." + rowClass).length;

        // Prepend new rows
        if (offset < grids[gridName].offset && row_count) {
            for (let index = grids[gridName].offset; index > offset; index--) {
                const row = this.grid_prepare_row(gridName, drow, index);

                // Insert row in grid container
                row.insertBefore($grid.find("." + rowClass + ".row-" + (index + 1)));

                // Init children grids
                this.grid_initialize_children($grid, gridName, index);
            }
        }

        grids[gridName].offset = offset;

        // Append new rows
        row_count = $grid.find("." + rowClass).length;
        const max_index = Math.min(grids[gridName].offset + grids[gridName].page_limit, grids[gridName].count) - 1;
        for (let index = offset + row_count; index <= max_index; index++) {
            const row = this.grid_prepare_row(gridName, drow, index + 1);

            // Insert row in grid container
            row.insertBefore(drow_original);

            // Init children grids
            this.grid_initialize_children($grid, gridName, index + 1);
        }

        const self = this;

        // Fill values
        $grid.find("." + rowClass + " input.unprocessed").each(function () {
            const $element = jQuery(this);
            const value = self.grid_get_element_value($element);
            self.grid_set_input_value($element, value);
            self.grid_init_datepicker($element);
            self.grid_init_file_widget($element);
        });

        $grid.find("." + rowClass + " select.unprocessed").each(function () {
            const $element = jQuery(this);
            const value = self.grid_get_element_value($element);
            self.grid_set_select_value($element, value);
            self.grid_init_select2($element);
        });

        $grid.find("." + rowClass).find("select.unprocessed, input.unprocessed").each(function () {
            jQuery(this).trigger("mywebform:gridRefreshField");
            jQuery(this).removeClass("unprocessed");
        });

        this.grid_update_pager($grid, gridName);

        validationMarkFields();
        $grid.trigger("grid_refresh", offset);
    }

    static grid_remove_rows($grid, gridName, offset) {
        $grid.find("." + this.grid_combine_class(gridName, "row")).each(function () {
            const index = parseInt(jQuery(this).attr("row-index"));
            if (index <= offset || index > offset + grids[gridName].page_limit) {
                jQuery(this).remove();
            }
        });
    }

    static grid_reindex_errors_down(gridName, rowIndex) {
        const parentIndex = Number(this.grid_get_parent_index(gridName)) - 1;
        const originalGridName = grids[gridName].gridInfo.name;
        const childrenGrids = grids[gridName].gridInfo.grids;
        const deleteIndex = rowIndex - 1;

        const errorsForRemoval = [];
        for (const x in webform.errors) {
            if (webform.errors[x].fieldName) {
                const field = Drupal.settings.mywebform.fields[webform.errors[x].fieldName];
                if (field.grid_name == originalGridName) {
                    if (parentIndex >= 0 && field.parent_grid_name) {
                        if (webform.errors[x].parentIndex == parentIndex) {
                            if (webform.errors[x].index == deleteIndex) {
                                errorsForRemoval.push(x);
                            } else if (webform.errors[x].index >= rowIndex) {
                                webform.errors[x].index--;
                            }
                        }
                    } else if (!field.parent_grid_name) {
                        if (webform.errors[x].index == deleteIndex) {
                            errorsForRemoval.push(x);
                        } else if (webform.errors[x].index >= rowIndex) {
                            webform.errors[x].index--;
                        }
                    }
                } else if (childrenGrids.indexOf(field.grid_name) != -1) {
                    if (webform.errors[x].parentIndex == deleteIndex) {
                        errorsForRemoval.push(x);
                    } else if (webform.errors[x].parentIndex >= rowIndex) {
                        webform.errors[x].parentIndex--;
                    }
                }
            }
        }

        for (let i = errorsForRemoval.length - 1; i >= 0; i--) {
            webform.errors.splice(errorsForRemoval[i], 1);
        }
    }

    static grid_reindex_errors_up(gridName, rowIndex) {
        const parentIndex = Number(this.grid_get_parent_index(gridName)) - 1;
        const originalGridName = grids[gridName].gridInfo.name;
        const childrenGrids = grids[gridName].gridInfo.grids;

        for (const x in webform.errors) {
            if (webform.errors[x].fieldName) {
                const field = Drupal.settings.mywebform.fields[webform.errors[x].fieldName];
                if (field.grid_name == originalGridName) {
                    if (parentIndex >= 0 && field.parent_grid_name) {
                        if (webform.errors[x].parentIndex == parentIndex) {
                            if (webform.errors[x].index >= rowIndex) {
                                webform.errors[x].index++;
                            }
                        }
                    } else if (!field.parent_grid_name) {
                        if (webform.errors[x].index >= rowIndex) {
                            webform.errors[x].index++;
                        }
                    }
                } else if (childrenGrids.indexOf(field.grid_name) != -1) {
                    if (webform.errors[x].parentIndex >= rowIndex) {
                        webform.errors[x].parentIndex++;
                    }
                }
            }
        }
    }

    static grid_remove_fields(gridName, index, parentIndex) {
        for (let i = 0; i < grids[gridName].gridInfo.fields.length; i++) {
            const fieldName = grids[gridName].gridInfo.fields[i];
            this.grid_remove_field_value(fieldName, index, parentIndex);

            if (this.grid_is_file_field(fieldName)) {
                this.grid_remove_file_value(fieldName, index, parentIndex);
            }
        }

        const childrenCount = grids[gridName].gridInfo.grids.length;
        for (let i = 0; i < childrenCount; i++) {
            const childGridName = grids[gridName].gridInfo.grids[i];
            for (let k = 0; k < Drupal.settings.mywebform.grids[childGridName].fields.length; k++) {
                const fieldName = Drupal.settings.mywebform.grids[childGridName].fields[k];
                this.grid_remove_field_value(fieldName, index);

                if (this.grid_is_file_field(fieldName)) {
                    this.grid_remove_file_value(fieldName, index);
                }
            }
        }
    }

    static grid_remove_children_grids(gridName, index) {
        const childrenCount = grids[gridName].gridInfo.grids.length;
        for (let i = 0; i < childrenCount; i++) {
            const childGridName = grids[gridName].gridInfo.grids[i] + "-" + index;
            if (grids.hasOwnProperty(childGridName)) {
                delete grids[childGridName];
            }
        }
    }

    static grid_reindex_index_field_down(indexField, index, parentIndex, defaultMinIndex) {
        const values = this.grid_get_field_values(indexField, parentIndex);

        for (let i = index; i < values.length; i++) {
            if (parentIndex > 0 || parentIndex === 0) {
                Drupal.settings.mywebform.values[indexField][parentIndex][i] = String(Math.max(Number(Drupal.settings.mywebform.values[indexField][parentIndex][i]) - 1, defaultMinIndex));
            } else {
                Drupal.settings.mywebform.values[indexField][i] = String(Math.max(Number(Drupal.settings.mywebform.values[indexField][i]) - 1, defaultMinIndex));
            }
        }
    }

    static grid_reindex_index_field_up(indexField, index, parentIndex) {
        const values = this.grid_get_field_values(indexField, parentIndex);

        for (let i = index; i < values.length; i++) {
            if (parentIndex > 0 || parentIndex === 0) {
                Drupal.settings.mywebform.values[indexField][parentIndex][i] = String(Number(Drupal.settings.mywebform.values[indexField][parentIndex][i]) + 1);
            } else {
                Drupal.settings.mywebform.values[indexField][i] = String(Number(Drupal.settings.mywebform.values[indexField][i]) + 1);
            }
        }
    }

    /**
     * Removes a specified row from the grid
     */
    static grid_remove_row(gridName, index) {
        const indexField = grids[gridName].gridInfo.defField;
        const $grid = this.grid_get_grid_element(gridName);
        const parentIndex = Number(this.grid_get_parent_index(gridName));
        const $row = $grid.find("." + this.grid_combine_class(gridName, "row") + ".row-" + index);
        const reindex = this.grid_is_reindex_enabled(gridName);

        $row.remove();

        this.grid_remove_fields(gridName, index - 1, parentIndex - 1);
        this.grid_remove_children_grids(gridName, index);

        grids[gridName].count = Math.max(0, grids[gridName].count - 1);
        grids[gridName].offset = Math.max(0, Math.min(grids[gridName].offset, grids[gridName].count));
        if (grids[gridName].offset >= grids[gridName].count) {
            grids[gridName].offset = (Math.max(1, Math.ceil(grids[gridName].count / grids[gridName].page_limit)) - 1) * grids[gridName].page_limit;
        }

        if (indexField && reindex) {
            const defaultMinIndex = this.grid_get_default_min_index(gridName);
            this.grid_reindex_index_field_down(indexField, index - 1, parentIndex - 1, defaultMinIndex);
        }

        this.grid_reindex_rows_down(gridName, $grid, index + 1);

        // Reindex errors
        this.grid_reindex_errors_down(gridName, index);

        this.grid_refresh(this.grid_get_grid_element(gridName), gridName, grids[gridName].offset);

        $grid.trigger("row_deleted", index);
        $grid.removeClass("grid-delete-row-processing");
    }

    static grid_reset(gridName, addDefaultRows) {
        const $grid = jQuery("#" + gridName);
        const parentIndex = Number(this.grid_get_parent_index(gridName));
        const originalGridName = grids[gridName].gridInfo.name;
        const originalGridObj = Drupal.settings.mywebform.grids[originalGridName];
        const maxIndex = grids[gridName].count;

        $grid.find("." + this.grid_combine_class(gridName, "row")).remove();

        const parentIndexArr = parentIndex - 1;
        for (let i = 0; i < originalGridObj.fields.length; i++) {
            this.grid_reset_field_values(originalGridObj.fields[i], parentIndexArr);

            if (this.grid_is_file_field(originalGridObj.fields[i])) {
                this.grid_reset_file_values(originalGridObj.fields[i], parentIndexArr);
            }
        }

        for (let k = 0; k < originalGridObj.grids.length; k++) {
            const originalChildGridName = originalGridObj.grids[k];
            for (let fk = 0; fk < Drupal.settings.mywebform.grids[originalChildGridName].fields.length; fk++) {
                const fieldName = Drupal.settings.mywebform.grids[originalChildGridName].fields[fk];

                this.grid_reset_field_values(fieldName);

                if (this.grid_is_file_field(fieldName)) {
                    this.grid_reset_file_values(fieldName);
                }
            }

            for (let i = 1; i <= maxIndex; i++) {
                const childGridName = originalChildGridName + "-" + i;
                if (grids.hasOwnProperty(childGridName)) {
                    delete grids[childGridName];
                }
            }
        }

        grids[gridName] = {
            "gridInfo": originalGridObj,
            "page_limit": Drupal.settings.mywebform.grid_page_limit,
            "offset": 0,
            "pages": 0,
            "curPage": 0,
            "count": 0,
            "parentIndex": parentIndex > 0 ? parentIndex : false
        };

        this.grid_update_pager($grid, gridName);

        addDefaultRows = addDefaultRows === undefined ? true : addDefaultRows;
        if (addDefaultRows) {
            const row_count = this.grid_get_default_row_count(gridName);
            for (let c = 0; c < row_count; c++) {
                $grid.find("a." + this.grid_combine_class(gridName, "grid-addrow")).trigger("click");
            }
        }
    }

    static grid_add_row_inline(gridName, index) {
        const indexField = grids[gridName].gridInfo.defField;
        const $grid = this.grid_get_grid_element(gridName);
        const parentIndex = this.grid_get_parent_index(gridName);
        let maxIndex = 0;
        const toIndex = Number(index);
        const reindex = this.grid_is_reindex_enabled(gridName);

        if (indexField) {
            if (reindex) {
                const fieldValues = this.grid_get_field_values(indexField, Number(parentIndex) - 1);
                maxIndex = parseInt(fieldValues[toIndex - 1]);
            }
        }

        if (isNaN(maxIndex)) {
            maxIndex = 0;
        }

        maxIndex++;

        let indexValue = maxIndex;
        if (!reindex) {
            indexValue = "";
        }

        if (indexField && reindex) {
            this.grid_reindex_index_field_up(indexField, toIndex, Number(parentIndex) - 1);
        }

        for (const x in grids[gridName].gridInfo.fields) {
            const fieldName = grids[gridName].gridInfo.fields[x];
            if (fieldName == indexField) {
                this.grid_push_field_value(fieldName, indexValue, Number(parentIndex) - 1, toIndex);
            } else {
                this.grid_push_field_value(fieldName, jQuery("#" + fieldName).val(), Number(parentIndex) - 1, toIndex);

                if (this.grid_is_file_field(fieldName)) {
                    this.grid_push_file_value(fieldName, {}, Number(parentIndex) - 1, toIndex);
                }
            }
        }

        this.grid_init_children_fields(gridName, toIndex);

        const newIndex = toIndex + 1;
        const rowClass = this.grid_combine_class(gridName, "row");
        const drow_original = this.grid_get_drow($grid, gridName);
        const drow = this.grid_get_unprocessed_row_from_drow(gridName, drow_original);
        const row = this.grid_prepare_row(gridName, drow, newIndex);

        // Reindex rows
        this.grid_reindex_rows_up(gridName, $grid, newIndex);

        // Reindex errors
        this.grid_reindex_errors_up(gridName, toIndex);

        // Insert row in grid container
        row.insertAfter($grid.find("." + rowClass + ".row-" + toIndex));

        // Init children grids
        this.grid_initialize_children($grid, gridName, newIndex);

        grids[gridName].count++;
        const offset = Math.max((grids[gridName].curPage - 1) * grids[gridName].page_limit, 0);
        this.grid_refresh($grid, gridName, offset);

        this.grid_trigger_change_index_field($grid, gridName, parentIndex, newIndex);

        $grid.trigger("row_added");
    }

    static grid_reindex_child_grid($grid, gridName, newParentIndex) {
        const originalChildGridName = grids[gridName].gridInfo.name;
        const newName = originalChildGridName + "-" + newParentIndex;

        const grid_add_row_class = this.grid_combine_class(gridName, "grid-addrow");
        const grid_add_row_inline_class = this.grid_combine_class(gridName, "grid-addrow-inline");
        const grid_dellrow_class = this.grid_combine_class(gridName, "grid-delrow");
        const grid_drow_class = this.grid_combine_class(gridName, "drow");
        const row_class = this.grid_combine_class(gridName, "row");
        const row_index_class = this.grid_combine_class(gridName, "row-index");
        const grid_scroll_class = this.grid_combine_class(gridName, "grid-scroll");

        const self = this;


        $grid.find("a." + grid_add_row_class)
            .removeClass(grid_add_row_class)
            .attr("grid", newName)
            .addClass(this.grid_combine_class(newName, "grid-addrow"));

        $grid.find("a." + grid_add_row_inline_class)
            .removeClass(grid_add_row_inline_class)
            .attr("grid", newName)
            .addClass(this.grid_combine_class(newName, "grid-addrow-inline"));

        $grid.find("a." + grid_dellrow_class)
            .removeClass(grid_dellrow_class)
            .attr("grid", newName)
            .addClass(this.grid_combine_class(newName, "grid-delrow"));

        $grid.find("." + grid_drow_class)
            .removeClass(grid_drow_class)
            .addClass(this.grid_combine_class(newName, "drow"));

        $grid.find("." + row_class)
            .removeClass(row_class)
            .addClass(this.grid_combine_class(newName, "row"));

        $grid.find("." + row_index_class)
            .removeClass(row_index_class)
            .addClass(this.grid_combine_class(newName, "row-index"));

        $grid.find("." + grid_scroll_class + " a").each(function () {
            jQuery(this).attr("grid", newName);
        });

        $grid.find("." + grid_scroll_class)
            .removeClass(grid_scroll_class)
            .addClass(this.grid_combine_class(newName, "grid-scroll"));

        $grid.find(".row, .drow").find("input, select, span.form-item").not(".child-grid").each(function () {
            const $field = jQuery(this);
            const row_index = parseInt($field.attr("row-index"));
            self.grid_set_fields_attr($field, row_index, newParentIndex);

            if (row_index) {
                self.grid_reinit_select2_field($field);
                self.grid_reinit_datepicker_field($field);
                self.grid_reinit_file_field($field);
            }
        });

        $grid.attr("id", newName);
    }

    static grid_reindex_row($row, gridName, oldIndex, newIndex) {
        const childrenCount = grids[gridName].gridInfo.grids.length;
        let parentIndex = parseInt(this.grid_get_parent_index(gridName));
        parentIndex = isNaN(parentIndex) ? -1 : parentIndex;
        const self = this;

        for (let i = 0; i < childrenCount; i++) {
            const originalChildGridName = grids[gridName].gridInfo.grids[i];
            if (Drupal.settings.mywebform.grids.hasOwnProperty(originalChildGridName)) {
                const childGridName = originalChildGridName + "-" + oldIndex;
                const $childGrid = $row.find("#" + childGridName);
                this.grid_reindex_child_grid($childGrid, childGridName, newIndex);

                $childGrid.find(".row, .drow").find("input, select, span.form-item").addClass("child-grid");
            }
        }

        $row.attr("row-index", newIndex);
        $row.removeClass("row-" + oldIndex)
            .addClass("row-" + newIndex);
        $row.find("input, select, span.form-item").not(".child-grid").each(function () {
            const $field = jQuery(this);
            self.grid_set_fields_attr($field, newIndex, parentIndex);
            self.grid_reinit_select2_field($field);
            self.grid_reinit_datepicker_field($field);

            if (self.grid_is_reindex_enabled(gridName) && $field.hasClass("row-index")) {
                const value = self.grid_get_element_value($field);
                self.grid_set_input_value($field, value);
            }
        });

        $row.find(".child-grid").removeClass("child-grid");
    }

    static grid_reindex_rows_up(gridName, $grid, index) {
        const rowClass = this.grid_combine_class(gridName, "row");
        const self = this;

        jQuery("#" + gridName + " a.grid-addrow").addClass("disabled");

        jQuery($grid.find("." + rowClass).get().reverse()).each(function () {
            const row_index = parseInt(jQuery(this).attr("row-index"));

            if (row_index >= index) {
                const newIndex = row_index + 1;
                self.grid_reindex_row(jQuery(this), gridName, row_index, newIndex);
            }
        });

        this.grid_reindex_children_grids_object_up(gridName, index);

        jQuery("#" + gridName + " a.grid-addrow").removeClass("disabled");
    }

    static grid_reindex_rows_down(gridName, $grid, index) {
        const rowClass = this.grid_combine_class(gridName, "row");
        const self = this;

        jQuery($grid.find("." + rowClass).get().reverse()).each(function () {
            const row_index = parseInt(jQuery(this).attr("row-index"));

            if (row_index >= index) {
                const newIndex = row_index - 1;
                self.grid_reindex_row(jQuery(this), gridName, row_index, newIndex);
            }
        });

        this.grid_reindex_children_grids_object_down(gridName, index);
    }

    static grid_reinit_select2_field($field) {
        const isSelect2Field = this.grid_is_select2_included() && $field.hasClass("select2-widget");

        if (isSelect2Field) {
            $field.removeClass("error");
            $field.myWebformSelect2("destroy");

            this.grid_init_select2($field);
        }
    }

    static grid_reinit_file_field($field) {
        if ($field.hasClass(".mywebform-file-widget")) {
            $field.myWebformFile("destroy");

            this.grid_init_file_widget($field);
        }
    }

    static grid_reinit_datepicker_field($field) {
        if ($field.hasClass("date") && $field.datepicker) {
            $field.datepicker("destroy");
            this.grid_init_datepicker($field);
        }
    }

    static grid_reindex_children_grids_object_up(gridName, index, maxIndex) {
        const childrenGrids = grids[gridName].gridInfo.grids;
        index = Number(index);

        if (index <= maxIndex) {
            const gridsObj = {};
            for (let i = index; i <= maxIndex; i++) {
                for (let k = 0; k < childrenGrids.length; k++) {
                    const oldName = childrenGrids[k] + "-" + i;
                    const parentIndex = i + 1;
                    const newName = childrenGrids[k] + "-" + parentIndex;

                    if (grids.hasOwnProperty(oldName)) {
                        gridsObj[newName] = grids[oldName];
                        gridsObj[newName].parentIndex = parentIndex;
                        delete grids[oldName];
                    }
                }
            }

            for (const name in gridsObj) {
                grids[name] = gridsObj[name];
            }
        }
    }

    static grid_reindex_children_grids_object_down(gridName, index) {
        const childrenGrids = grids[gridName].gridInfo.grids;
        index = Number(index);
        const maxIndex = parseInt(grids[gridName].count) + 1;

        if (index <= maxIndex) {
            const gridsObj = {};
            for (let i = index; i <= maxIndex; i++) {
                for (let k = 0; k < childrenGrids.length; k++) {
                    const oldName = childrenGrids[k] + "-" + i;
                    const parentIndex = i - 1;
                    const newName = childrenGrids[k] + "-" + parentIndex;

                    if (grids.hasOwnProperty(oldName)) {
                        gridsObj[newName] = grids[oldName];
                        gridsObj[newName].parentIndex = parentIndex;
                        delete grids[oldName];
                    }
                }
            }

            for (const name in gridsObj) {
                grids[name] = gridsObj[name];
            }
        }
    }
}

class MyWebformGrid extends MyWebformGridBase {
    /**
     * Update grid's pager
     */
    static grid_update_pager($grid, gridName) {
        const pages = Math.max(1, Math.ceil(grids[gridName].count / grids[gridName].page_limit));
        const curPage = Math.floor(grids[gridName].offset / grids[gridName].page_limit) + 1;
        const $pager = $grid.find("." + this.grid_combine_class(gridName, "grid-scroll"));

        if (pages != grids[gridName].pages) {
            grids[gridName].pages = pages;
            grids[gridName].curPage = 0;

            var str = '';
            for (var x = 1; x <= pages; x++) {
                str += '<li><a href="#" grid="' + gridName + '" class="page-jump page-' + x + '" page="' + x + '">' + x + '</a></li>';
            }
            $pager.find('ul.pages').html(str);

            if (pages == 1) {
                $pager.hide();
            }
            else {
                $pager.show();
            }
        }

        if (curPage != grids[gridName].curPage) {
            grids[gridName].curPage = curPage;
            $pager.find('.pages .page-jump').removeClass('active');
            $pager.find('.pages .page-' + curPage).addClass('active');
        }
    }

    static grid_initialize_pager($grid, gridName, addLineScrollButtons) {
        // Insert grid's scroll buttons and pages
        let str = "";
        str += "<div class=\"grid-scroll " + this.grid_combine_class(gridName, "grid-scroll flex-col") + "\">";
        str += "<ul class=\"scroll\">";
        str += "<li><a href=\"#\" grid=\"" + gridName + "\" class=\"scroll-start\">Start</a></li>";
        str += "<li><a href=\"#\" grid=\"" + gridName + "\" class=\"scroll-pgdn\">Page down</a></li>";
        if (addLineScrollButtons) {
            str += "<li><a href=\"#\" grid=\"" + gridName + "\" class=\"scroll-down\">Line down</a></li>";
        }
        if (addLineScrollButtons) {
            str += "<li><a href=\"#\" grid=\"" + gridName + "\" class=\"scroll-up\">Line up</a></li>";
        }
        str += "<li><a href=\"#\" grid=\"" + gridName + "\" class=\"scroll-pgup\">Page up</a></li>";
        str += "<li><a href=\"#\" grid=\"" + gridName + "\" class=\"scroll-end\">End</a></li>";
        str += "</ul>";
        str += '<ul class="pages"></ul>';
        str += "<div style=\"clear: both;\"></div>";
        str += "</div>";
        $grid.prepend(str);
    }

    static register_pager_events(container_id) {
        super.register_pager_events(container_id);
        const self = this;
        jQuery(container_id).on("click", "a.page-jump", function () {
            const gridName = jQuery(this).attr("grid");
            const page = parseInt(jQuery(this).attr("page"));
            const offset = (page - 1) * grids[gridName].page_limit;
            self.grid_refresh(self.grid_get_grid_element(gridName), gridName, offset);
            return false;
        });
    }
}

let MyWebformViewGridMixin = (superclass) => class extends superclass {
    static grids_initialize() {
        // Remove "Add row" buttons
        jQuery("a.grid-addrow").remove();

        super.grids_initialize();

        if (Drupal.settings.mywebform.print) {
            setTimeout(window.print, 10);
        }
    }

    static grid_initialize_view($grid, gridName) {
        this.grid_refresh($grid, gridName, grids[gridName].offset);
    }

    static grid_prepare_row(gridName, drow, index) {
        const row = drow.clone();
        const drowClass = this.grid_combine_class(gridName, "drow");
        const rowClass = this.grid_combine_class(gridName, "row");
        let parentIndex = parseInt(this.grid_get_parent_index(gridName));
        parentIndex = isNaN(parentIndex) ? -1 : parentIndex;
        const self = this;

        row.find(".drow .form-item").addClass("child-grid");
        row.removeClass("drow " + drowClass);
        row.addClass("row " + rowClass + " row-" + index);
        row.attr("row-index", index);

        row.find(".form-item:not(.child-grid)").each(function (i) {
            const fieldName = jQuery(this).attr("field");
            let id = fieldName;

            if (parentIndex > 0 || parentIndex === 0) {
                id += "-" + parentIndex;
                jQuery(this).attr("parent-index", parentIndex);
            }
            id += "-" + index;

            jQuery(this).attr("row-index", index);

            const values = self.grid_get_field_values(fieldName, Number(parentIndex) - 1);
            jQuery(this).attr("id", id).html(values[index - 1]);

            const field = Drupal.settings.mywebform.fields.hasOwnProperty(fieldName) ? Drupal.settings.mywebform.fields[fieldName] : false;
            if (field) {
                if (field.widget == "file") {
                    jQuery(this).myWebformFile();
                }
            }
        });

        row.show();
        row.find("child-grid").removeClass("child-grid");

        this.grid_prepare_children(gridName, row, index);

        return row;
    }

    static grid_prepare_children(gridName, row, index) {
        const childrenCount = grids[gridName].gridInfo.grids.length;

        for (let i = 0; i < childrenCount; i++) {
            const childGridName = grids[gridName].gridInfo.grids[i];

            row.find("#" + childGridName).attr("id", childGridName + "-" + index);
        }
    }

    static grid_initialize_children($grid, gridName, index) {
        const childrenCount = grids[gridName].gridInfo.grids.length;
        for (let i = 0; i < childrenCount; i++) {
            const originalChildGridName = grids[gridName].gridInfo.grids[i];
            if (Drupal.settings.mywebform.grids.hasOwnProperty(originalChildGridName)) {
                const childGridName = originalChildGridName + "-" + index;
                const $childGrid = $grid.find("#" + childGridName);

                this.grid_initialize($childGrid, childGridName, Drupal.settings.mywebform.grids[originalChildGridName], index);
            }
        }
    }

    static register_events() {
        this.register_pager_events("#mywebform-content");
    }
}

class MyWebformViewGrid extends MyWebformViewGridMixin(MyWebformGridBase) {
    static grid_refresh($grid, gridName, offset) {
        this.grid_remove_rows($grid, gridName, offset);

        const rowClass = this.grid_combine_class(gridName, "row");
        const drow_original = this.grid_get_drow($grid, gridName);
        const drow = this.grid_get_unprocessed_row_from_drow(gridName, drow_original);

        let row_count = $grid.find("." + rowClass).length;

        // Prepend new rows
        if (offset < grids[gridName].offset && row_count) {
            for (let index = grids[gridName].offset; index > offset; index--) {
                const row = this.grid_prepare_row(gridName, drow, index);

                // Insert row in grid container
                row.insertBefore($grid.find("." + rowClass + ".row-" + (index + 1)));

                // Init children grids
                this.grid_initialize_children($grid, gridName, index);
            }
        }

        grids[gridName].offset = offset;

        // Append new rows
        row_count = $grid.find("." + rowClass).length;
        const max_index = Math.min(grids[gridName].offset + grids[gridName].page_limit, grids[gridName].count) - 1;
        for (let index = offset + row_count; index <= max_index; index++) {
            const row = this.grid_prepare_row(gridName, drow, index + 1);

            // Insert row in grid container
            row.insertBefore(drow_original);

            // Init children grids
            this.grid_initialize_children($grid, gridName, index + 1);
        }

        this.grid_update_pager($grid, gridName);
    }
}

class MyWebformAjaxGrid extends MyWebformGridBase {
    static grid_initialize($grid, gridName, gridInfo, parentIndex) {
        this.grid_set_initial_data(gridName, gridInfo, parentIndex);
        this.grid_set_attr($grid, gridName);
        this.grid_initialize_pager($grid, gridName, true);
        this.grid_update_pager($grid, gridName);
        this.grid_initialize_view($grid, gridName);
    }

    static grid_set_initial_data(gridName, gridInfo, parentIndex) {
        grids[gridName] = Drupal.settings.mywebform.builtGrids[gridName];
    }

    static grid_update_pager($grid, gridName) {
        const pages = grids[gridName].pages;
        const curPage = grids[gridName].curPage;
        const $pager = $grid.find("." + this.grid_combine_class(gridName, "grid-scroll"));

        $pager.find("input.page-jump").attr("max", pages);

        if (pages == 1) {
            $pager.hide();
        }
        else {
            $pager.show();
        }

        if ($pager.find("input.page-jump").val() != curPage) {
            $pager.find("input.page-jump").val(curPage);
        }

        $pager.find(".pages-info .cur-page").html(curPage);
        $pager.find(".pages-info .total-pages").html(pages);
    }

    static grid_initialize_view($grid, gridName) {
        this.grid_refresh($grid, gridName, grids[gridName].offset);
    }

    /**
     * Refreshes the grid rows
     */
    static grid_refresh($grid, gridName, offset) {
        this.grid_remove_rows($grid, gridName, offset);

        const rowClass = this.grid_combine_class(gridName, "row");
        const drow_original = this.grid_get_drow($grid, gridName);
        const drow = this.grid_get_unprocessed_row_from_drow(gridName, drow_original);

        // Append new rows
        let row_count = $grid.find("." + rowClass).length;
        const max_index = Math.min(grids[gridName].offset + grids[gridName].page_limit, grids[gridName].count) - 1;
        for (let index = offset + row_count; index <= max_index; index++) {
            const row = this.grid_prepare_row(gridName, drow, index + 1);

            // Insert row in grid container
            row.insertBefore(drow_original);

            // Init children grids
            this.grid_initialize_children($grid, gridName, index + 1);
        }

        const self = this;

        // Fill values
        $grid.find("." + rowClass + " input.unprocessed").each(function () {
            const $element = jQuery(this);
            const value = self.grid_get_element_value($element);
            self.grid_set_input_value($element, value);
            self.grid_init_datepicker($element);
            self.grid_init_file_widget($element);
        });

        $grid.find("." + rowClass + " select.unprocessed").each(function () {
            const $element = jQuery(this);
            const value = self.grid_get_element_value($element);
            self.grid_set_select_value($element, value);
            self.grid_init_select2($element);
        });

        $grid.find("." + rowClass).find("select.unprocessed, input.unprocessed").each(function () {
            jQuery(this).trigger("mywebform:gridRefreshField");
            jQuery(this).removeClass("unprocessed");
        });

        this.grid_update_pager($grid, gridName);

        validationMarkFields();
    }

    static grid_get_field_values(fieldName, parentIndex) {
        let values = {};
        if (Drupal.settings.mywebform.values.hasOwnProperty(fieldName)) {
            values = Drupal.settings.mywebform.values[fieldName];

            if (this.isObject(values)) {
                if (parentIndex > 0 || parentIndex === 0) {
                    values = Drupal.settings.mywebform.values[fieldName][parentIndex];
                    if (!this.isObject(values)) {
                        values = {};
                    }
                }
            } else {
                values = {};
            }
        }

        return values;
    }

    static grid_push_value(key, fieldName, value, parentIndex, toIndex) {
        if (!this.isObject(Drupal.settings.mywebform[key][fieldName])) {
            Drupal.settings.mywebform[key][fieldName] = {};
        }

        if (parentIndex > 0 || parentIndex === 0) {
            if (!this.isObject(Drupal.settings.mywebform[key][fieldName][parentIndex])) {
                Drupal.settings.mywebform[key][fieldName][parentIndex] = {};
            }

            if (toIndex > 0 || toIndex === 0) {
                Drupal.settings.mywebform[key][fieldName][parentIndex][toIndex] = value;
            } else {
                toIndex = this.getObjectMaxKey(Drupal.settings.mywebform[key][fieldName][parentIndex]) + 1;
                Drupal.settings.mywebform[key][fieldName][parentIndex][toIndex] = value;
            }
        } else {
            if (toIndex > 0 || toIndex === 0) {
                Drupal.settings.mywebform[key][fieldName][toIndex] = value;
            } else {
                toIndex = this.getObjectMaxKey(Drupal.settings.mywebform[key][fieldName]) + 1;
                Drupal.settings.mywebform[key][fieldName][toIndex] = value;
            }
        }
    }

    static getObjectMaxKey(values) {
        let max = -1;
        const keys = Object.keys(values);
        if (keys.length) {
            max = Math.max(...keys);
        }

        return max;
    }

    static isObject(value) {
        return typeof value === "object" && value !== null;
    }

    static grid_initialize_pager($grid, gridName, addLineScrollButtons) {
        return super.grid_initialize_pager($grid, gridName, false);
    }

    static grid_remove_rows_from_index($grid, gridName, fromIndex) {
        $grid.find("." + this.grid_combine_class(gridName, "row")).each(function () {
            const index = parseInt(jQuery(this).attr("row-index"));
            if (index >= fromIndex) {
                jQuery(this).remove();
            }
        });
    }

    static goToPage(gridName, page) {
        const data = {
            "grid_name": gridName,
            "op": "go_to_page",
            "page": page,
        };
        webform.executeDraftRequest(data, (response) => {
            if (response) {
                Drupal.settings.mywebform.values = response.values;
                Drupal.settings.mywebform.builtGrids = response.builtGrids;
                grids = response.builtGrids;
                this.grid_refresh(this.grid_get_grid_element(gridName), gridName, response.builtGrids[gridName].offset);
            }
        });
    }

    static grid_add_row(gridName) {
        const data = {
            "grid_name": gridName,
            "op": "add_row",
        };
        webform.executeDraftRequest(data, (response) => {
            if (response) {
                const $grid = this.grid_get_grid_element(gridName);
                Drupal.settings.mywebform.values = response.values;
                Drupal.settings.mywebform.builtGrids = response.builtGrids;
                grids = response.builtGrids;
                this.grid_refresh($grid, gridName, response.builtGrids[gridName].offset);
                mywebform_sync_form_fields_from_values();
                $grid.trigger("row_added");
            }
        });
    }

    static grid_add_row_inline(gridName, rowIndex) {
        const data = {
            "grid_name": gridName,
            "op": "add_row_inline",
            "row_index": rowIndex + 1,
        };
        webform.executeDraftRequest(data, (response) => {
            if (response) {
                const $grid = this.grid_get_grid_element(gridName);
                Drupal.settings.mywebform.values = response.values;
                Drupal.settings.mywebform.builtGrids = response.builtGrids;
                grids = response.builtGrids;
                this.grid_remove_rows_from_index($grid, gridName, rowIndex + 1);
                this.grid_reindex_errors_up(gridName, rowIndex);
                this.grid_refresh($grid, gridName, response.builtGrids[gridName].offset);
                mywebform_sync_form_fields_from_values();
                $grid.trigger("row_added");
            }
        });
    }

    static grid_remove_row(gridName, rowIndex) {
        const data = {
            "grid_name": gridName,
            "op": "remove_row",
            "row_index": rowIndex,
        };
        webform.executeDraftRequest(data, (response) => {
            if (response) {
                const $grid = this.grid_get_grid_element(gridName);
                Drupal.settings.mywebform.values = response.values;
                Drupal.settings.mywebform.builtGrids = response.builtGrids;
                grids = response.builtGrids;
                this.grid_remove_rows_from_index($grid, gridName, rowIndex);
                this.grid_reindex_errors_down(gridName, rowIndex);
                this.grid_refresh($grid, gridName, response.builtGrids[gridName].offset);
                mywebform_sync_form_fields_from_values();
                $grid.trigger("row_deleted", rowIndex);
            }
        });
    }

    static grid_reset(gridName, addDefaultRows) {
        const $grid = jQuery("#" + gridName);
        const parentIndex = Number(this.grid_get_parent_index(gridName));

        this.grid_remove_rows_from_index($grid, gridName, 1);
        this.grid_initialize($grid, gridName, grids[gridName].gridInfo, parentIndex);
    }

    static register_events() {
        const self = this;
        jQuery("#mywebform-edit-form").on("click", ".delrow a", function (evt) {
            const gridName = jQuery(this).attr("grid");
            const rowIndex = parseInt(jQuery(this).parents("." + self.grid_combine_class(gridName, "row")).attr("row-index"));
            if (grids[gridName].count <= grids[gridName].gridInfo.defaultRowCount) {
                return false;
            }

            self.grid_remove_row(gridName, rowIndex);

            return false;
        });

        jQuery("#mywebform-edit-form").on("click", "a.grid-addrow", function () {
            if (!jQuery(this).hasClass("disabled")) {
                const gridName = jQuery(this).attr("grid");
                self.grid_add_row(gridName);
            }

            return false;
        });

        jQuery("#mywebform-edit-form").on("click", "a.grid-addrow-inline", function (ev) {
            if (!jQuery(this).hasClass("disabled")) {
                const gridName = jQuery(this).attr("grid");
                const rowIndex = parseInt(jQuery(this).parents("." + self.grid_combine_class(gridName, "row")).attr("row-index"));
                self.grid_add_row_inline(gridName, rowIndex);
            }

            return false;
        });

        this.register_pager_events("#mywebform-edit-form");
    }

    static register_pager_events(container_id) {
        const self = this;
        jQuery(container_id).on("click", ".scroll-start", function () {
            const gridName = jQuery(this).attr("grid");
            if (grids[gridName].curPage !== 1) {
                self.goToPage(gridName, 1);
            }
            return false;
        });

        jQuery(container_id).on("click", ".scroll-end", function (evt) {
            const gridName = jQuery(this).attr("grid");
            if (grids[gridName].curPage !== grids[gridName].pages) {
                self.goToPage(gridName, grids[gridName].pages);
            }
            return false;
        });

        jQuery(container_id).on("click", ".scroll-pgup", function () {
            const gridName = jQuery(this).attr("grid");
            const page = Math.min(grids[gridName].pages, grids[gridName].curPage + 1);
            if (grids[gridName].curPage !== page) {
                self.goToPage(gridName, page);
            }
            return false;
        });

        jQuery(container_id).on("click", ".scroll-pgdn", function () {
            const gridName = jQuery(this).attr("grid");
            const page = Math.max(1, grids[gridName].curPage - 1);
            if (grids[gridName].curPage !== page) {
                self.goToPage(gridName, page);
            }
            return false;
        });

        jQuery(container_id).on("change", "input.page-jump", function () {
            const gridName = jQuery(this).attr("grid");
            let page = parseInt(jQuery(this).val());

            if (page > grids[gridName].pages) {
                page = grids[gridName].pages;
            } else if (page < 1) {
                page = 1;
            }

            if (grids[gridName].curPage !== page) {
                self.goToPage(gridName, page);
            } else {
                self.grid_update_pager(self.grid_get_grid_element(gridName), gridName);
            }

            return false;
        });
    }
}

