function mywebform_get_grid_class() {
    if (!myWebformGridClass) {
        myWebformGridClass = MyWebformGridBase;
        if (Drupal.settings.mywebform.pagerTypeList) {
            myWebformGridClass = MyWebformGrid;
        }

        if (Drupal.settings.mywebform.preview) {
            myWebformGridClass = MyWebformViewGrid;
        }

        if (Drupal.settings.mywebform.serverSideProcessing) {
            myWebformGridClass = MyWebformAjaxGrid;
            if (Drupal.settings.mywebform.preview) {
                myWebformGridClass = MyWebformAjaxViewGrid;
            }
        }
    }

    return myWebformGridClass;
}

jQuery.fn.getGridObject = function () {
    const gridObject = {};

    if (this.length == 1) {
        const gridName = this.attr("id");
        if (grids.hasOwnProperty(gridName)) {
            return grids[gridName];
        }
    }

    return gridObject;
};

